import React, { useState } from 'react';
import { StyleSheet, Text, View, TouchableOpacity, Image } from 'react-native';

const style = StyleSheet.create({
  imagem: {
    width: 30,
    height: 30,
    borderWidth: 3,
    borderColor: '#000',
    borderRadius: 10,
  },
  box: {
    justifyContent: 'row'
  },
});

export default function Home({ route, navigation }) {
  let user = route.params.nome;
  let estilo = { ...route.params.estilo, ...style };
  // criação das state
  const [img, setImg] = useState();

  return (
    <View style={estilo.container}>
      <TouchableOpacity
        style={estilo.botao}
        onPress={() => navigation.navigate('Produto', { estilo: estilo })}
      >
        <Text style={estilo.texto}>{user}</Text>
      </TouchableOpacity>
      <Image source={{uri:'https://cdn.shopify.com/s/files/1/0788/5983/products/Copy_of_Google_Play_10_1024x1024.png'}}/>
    </View>
  );
}
